ConstValues.value:
"
  window.concierge = {
    actionlink: function(actionableLink) {
      try {
          webkit.messageHandlers.actionlink.postMessage(actionableLink);
      } catch(err) {
          console.log('An error happened: ' + err);
      }
    },

    analytics: function(analytics) {
      try {
         webkit.messageHandlers.analytics.postMessage(analytics);
      } catch(err) {
         console.log('An error happened when trying to send analytics: ' + err);
      }
    },

    error: function(error) {
      try {
         webkit.messageHandlers.error.postMessage(error);
      } catch(err) {
         console.log('An error happened when trying to send error log to native: ' + err);
      }
    },

    console: function(msg) {
        try {
           webkit.messageHandlers.console.postMessage(msg);
        } catch(err) {
           console.log('An error happened when trying to console command to native: ' + err);
        }
    },

    sendContext: function(ctx) {
        try {
           webkit.messageHandlers.sendContext.postMessage(ctx);
        } catch(err) {
           console.log('An error happened when trying to send context data to native: ' + err);
        }
    },

    dismiss: function(none) {
        try {
           webkit.messageHandlers.dismiss.postMessage(none);
        } catch(err) {
           console.log('An error happened when trying to dismiss command to native: ' + err);
        }
    },

    refresh: function() {
        try {
           webkit.messageHandlers.refresh.postMessage('');
        } catch(err) {
           console.log('An error happened when trying to send context data to native: ' + err);
        }
    }
  }"

"function primaryCallToAction(btnTitleForAnalytics) {
   try {
       webkit.messageHandlers.primaryConciergeBtnAction.postMessage({'btnTitleForAnalytics': btnTitleForAnalytics});
   } catch(err) {
       console.log('error' + err);
   }
}"

"function secondaryCallToAction(index, btnTitleForAnalytics) {
   try {
       webkit.messageHandlers.secondaryConciergeBtnAction.postMessage({'index': index,'btnTitleForAnalytics': btnTitleForAnalytics});
   } catch(err) {
       console.log('error' + err);
   }
}"
